import React, { Component } from 'react';
import logo from './logo.svg';
import Customer from './components/Customer';
import './App.css';
import Table from '@material-ui/core/Table';

const customer = [
  {
    'id':1,
    'image':"https://placeimg.com/64/64/any",
    'name':'홍길동',
    'birthday':'010713',
    'gender':'남자',
    'job':'프로그래머'
  }
]
class App extends Component{
  render(){
    return(
      <div>
        { customer.map(c => {
          return (
            <Customer
              key={c.id}
              id={c.id}
              image={c.image}
              name={c.name}
              birthday={c.birthday}
              gender={c.gender}
              job={c.job}
            />
          );
        })}
      </div>
    )
  }
}

export default App;
